import styled from 'styled-components';
import theme from '../../styles/theme';

export const Container = styled.div`
  margin: 50px 0px;
  display: flex;
  width: 100%;
  align-items: center;
  span {
    word-break: keep-all;
    letter-spacing: 1px;
  }
  ::before, ::after {
    content: '';
    display: block;
    width: 100%;
    height: 5px;
    background-color: ${theme.colors.primary};
  }
`;
